                WriteLiteral(@"
        <p>
            Like all land mammals that are pack hunters, the wolf feeds predominantly on wild herbivorous hoofed mammals that can be divided into large size 240–650 kg (530–1,430 lb) and medium size 23–130 kg (51–287 lb), and have a body mass similar to that of the combined mass of the pack members.
            The wolf specializes in preying on the vulnerable individuals of large prey,
            with a pack of 15 able to bring down an adult moose.
            The variation in diet between wolves living on different continents is based on the variety of hoofed mammals and of available smaller and domesticated prey.


            In North America, the wolf's diet is dominated by wild large hoofed mammals (ungulates) and medium-sized mammals. In Asia and Europe, their diet is dominated by wild medium-sized hoofed mammals and domestic species. 
            The wolf depends on wild species, and if these are not readily available, as in Asia, the wolf is more reliant on domestic species. 
");
